import{_ as t,o as p,c,N as s}from"./chunks/framework.4f99458b.js";const B=JSON.parse('{"title":"柳州旅游","description":"吃柳州吃螺蛳粉啦","frontmatter":{"title":"柳州旅游","date":"2023-04-12T00:00:00.000Z","description":"吃柳州吃螺蛳粉啦","tags":["日常"]},"headers":[],"relativePath":"日常/柳州旅游.md"}'),n={name:"日常/柳州旅游.md"},a=s('<p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-40-02.png" alt="柳州旅游-2024-01-26-20-40-02"></p><p>柳州总体给我的感觉是跟我家县城差不多，螺蛳粉确实还不错。我们第一天到达柳州放下行李就直奔一家在小红书挺有人气的小店，那个小店说是小店应该就是人家自己的家，然后类似我老家土房子的那种客厅，摆了两个长矮的桌子，然后就坐在那里吃，感觉就跟在家一样后厨就是他们的厨房排着长长的队伍，不过价格很便宜，我点了两份螺蛳粉，一份加了蛋和腊肠，一份加了虎皮鸡爪，味道是真的不错的</p><p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-40-26.png" alt="柳州旅游-2024-01-26-20-40-26"></p><p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-40-34.png" alt="柳州旅游-2024-01-26-20-40-34"></p><p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-40-51.png" alt="柳州旅游-2024-01-26-20-40-51"></p><p>下午去了龙潭公园，风景还不错，看山看水 还有个湖，我们不愿意走就骑着一个公园观光校车去玩</p><p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-41-01.png" alt="柳州旅游-2024-01-26-20-41-01"></p><p><img src="https://jsd.cdn.zzko.cn/gh/aymfx/pic/img/%E6%9F%B3%E5%B7%9E%E6%97%85%E6%B8%B8-2024-01-26-20-41-12.png" alt="柳州旅游-2024-01-26-20-41-12"></p>',8),e=[a];function i(E,_,o,d,g,m){return p(),c("div",null,e)}const h=t(n,[["render",i]]);export{B as __pageData,h as default};
